tx.validate( &ledger_params, &sender_acc_info, &sender_pre_path, &sender_post_path, &recipient_acc_info, &recipient_pre_path, &recipient_post_path, &initial_root, &final_root,
)?.enforce_equal(&Boolean::TRUE) The validate method is ultimately a very complex circuit using a variety of gadgets for Merkle proof and Schnorr signature verification that returns a Boolean. This gadget is also a building block for pretty much all other types, as it's the finite field representation of a bit. This way, types like UInt8 (see below) are implemented as arrays of Booleans underneath.

