Unsigned 8 bit integer type for circuits. Example: use ark_r1cs_std::bits::uint8::UInt8; let a = UInt8::new_input(cs, || Ok(1))?; let result = a.xor(&a)?;
let zero = UInt8::constant(0);
result.enforce_equal(&zero)?; As hinted above, it's important to understand that, underneath, a UInt8 is nothing more than an array of finite field elements. This has consequences for its use. For example, the verify function provided by the Marlin crate expects to be passed an array of the corresponding circuit's public inputs. Because this API is pretty low level and operations all happen in a elliptic curve over a finite field, the elements of this array are expected to be of type F: Field. However, when defining a circuit, you will usually be using high level constructs like UInt8. If you define a public input to be of type UInt8, when verifying you are responsible for making the conversion from it to &[F]. Note that this conversion is not simply using the from function given by finite fields, i.e., if your public inputs is a UInt8 of value 1, you can't do F::from(1) as the representation is actually let one = F::from(1);
let zero = F::from(0);
let public_input = vec![one, zero, zero, zero, zero, zero, zero, zero] There's a to_bits_le method defined by the ToBitsGadget that UInt8 implements, but it gives you a Vec<Boolean<F>>, not a Vec<F>. Another extra conversion needs to be made from Boolean to F.

