The Pedersen hash functions are nothing more than fixing an elliptic curve point G, and then doing hash(x) = xG for a given x, which is an element of a finite field. The Pedersen parameters are just the sampling of the G. Different values of G give rise to a different Pedersen Hash. Note that there's a very important difference between popular hash functions like Keccak/SHA3 and Pedersen: the input of SHA3 is just an array of bytes of arbitrary length, and its output a fixed byte array. On the other hand, Pedersen's input has to be a finite field element (and therefore cannot be of arbitrary length) and its output is an elliptic curve element. Indeed, this is the entire point of it; it's meant to be used in the context of ZK-SNARKS/circuits, where computation is done on elliptic curves over finite fields. The above poses a problem for Pedersen however. When using it as the underlying hash function for a Merkle Tree, one needs to take a pair of leaves or nodes and hash both to produce the next node in the tree. When using something like SHA3, what we do is hash the concatenation of the leaves/nodes, so we can use the same hash function we use to hash leaves to hash pairs of inner nodes. In the Pedersen case we can't do this, because the length of its inputs is fixed; concatenating inputs will not work. Because of this, Pedersen is usually divided into categories called OneToOne, TwoToOne, FourToOne, etc. OneToOne takes one input and produces one output, so it's used for hashing leaves; TwoToOne takes two inputs into one output and it's used for hashing pairs of leaves/nodes, and so on. With this in mind, let's take a look at the MerkleTree struct defined in Arkworks: pub struct MerkleTree<P: Config> { /// stores the non-leaf nodes in level order. The first element is the root node. /// The ith nodes (starting at 1st) children are at indices `2*i`, `2*i+1` non_leaf_nodes: Vec<TwoToOneDigest<P>>, /// store the hash of leaf nodes from left to right leaf_nodes: Vec<LeafDigest<P>>, /// Store the two-to-one hash parameters two_to_one_hash_param: TwoToOneParam<P>, /// Store the leaf hash parameters leaf_hash_param: LeafParam<P>, /// Stores the height of the MerkleTree height: usize,
} Here, the leaf_nodes are of type LeafDigest, which are different from the non_leaf_nodes, which are TwoToOneDigest. These are generic types that represent the output of a OneToOne and TwoToOne ZK-Friendly hash function (like Pedersen, but it could be another one), respectively. Additionally, there are leaf_hash_param and two_to_one_hash_param fields, containing the parameters mentioned above for the OneToOne and TwoToOne hash functions, respectively. If you're wondering, the generic type Config just contains the types of the two hash functions used: pub trait Config { type LeafHash: CRH; type TwoToOneHash: TwoToOneCRH;
} CRH stands for Collision Resistant Hash.

