We are going to write a circuit that just takes two numbers as input and checks if they are equal. We define a struct called TestCircuit #[derive(Clone)]
pub struct TestCircuit { /// Private input pub a: u8, /// Private input pub b: u8,
} As the comments suggest, circuit inputs can be either public or private. Private inputs are hidden to the verifier, i.e., after constructing a proof, the verifier does not have access to them; the proof itself proves that we know a value for it that satisfies the circuit without revealing it. Now we need to write the constraints for this circuit: use ark_r1cs_std::prelude::*;
use ark_relations::r1cs::{ConstraintSynthesizer, ConstraintSystemRef, SynthesisError}; impl ConstraintSynthesizer<ark_ed_on_bls12_381::Fq> for TestCircuit { fn generate_constraints( self, cs: ConstraintSystemRef<ark_ed_on_bls12_381::Fq>, ) -> Result<(), SynthesisError> { let a = UInt8::new_witness(ark_relations::ns!(cs, "a"), || Ok(self.a))?; let b = UInt8::new_witness(ark_relations::ns!(cs, "b"), || Ok(self.b))?; a.enforce_equal(&b)?; Ok(()) }
} For the generic F type, we are using a finite field defined in the ark_ed_on_bls12_381 crate. This is a crate implementing the bls 12-381 elliptic curve that we'll use later on for proving. To make our lives easier for now, we are using what Arkworks calls a Gadget. These are pre-generated circuits that we can use as building blocks for coding our constraints. You can sort of think of them as a standard library for circuits. In our example, we are using the UInt8 gadget, a way of defining and manipulating unsigned 8 bit integers in this context. Later on we will be showing how to do this without gadgets, defining our constraint manually. With the UInt8 gadget, we define two private inputs (also called witnesses) a and b, and then call the enforce_equal function between them (again, this function is provided by the gadget, we'll see below how to enforce this constraint by hand). To instantiate a circuit and check if the constraints are satisfied for a given set of inputs, we do the following: use ark_relations::r1cs::{ConstraintSynthesizer, ConstraintSystem}; let circuit = TestCircuit { a: 1, b: 1 }; let cs = ConstraintSystem::new_ref();
circuit.generate_constraints(cs.clone()).unwrap(); let is_satisfied = cs.is_satisfied().unwrap();
assert!(is_satisfied); Doing the same with the a and b inputs being different should fail.

