Let's write the same TestCircuit as before, but without using the UInt8 gadget. The struct definition is the same, but now the constraints are defined as follows: impl ConstraintSynthesizer<ark_ed_on_bls12_381::Fq> for TestCircuit { fn generate_constraints( self, cs: ConstraintSystemRef<ark_ed_on_bls12_381::Fq>, ) -> Result<(), SynthesisError> { let a = cs.new_witness_variable(|| { Fq::try_from(self.a).map_err(|_| SynthesisError::AssignmentMissing) })?; let b = cs.new_witness_variable(|| { Fq::try_from(self.b).map_err(|_| SynthesisError::AssignmentMissing) })?; cs.enforce_constraint(lc!(), lc!(), lc!() + (ark_ed_on_bls12_381::Fq::one(), a) - (ark_ed_on_bls12_381::Fq::one(), b))?; Ok(()) }
} To create the two private inputs, we now use the new_witness_variable method for the ConstraintSystem we get as an argument when generating constraints. Because every calculation inside a circuit actually happens in a finite field, to create the inputs we manually cast our a and b values to be field elements. Of course, the UInt8 gadget just does the same behind the scenes (the gadget treats a u8 as an array of 8 booleans using the Boolean gadget, which in turn calls this to do the conversion). Having created our inputs, we now manually define our constraint with the enforce_constraint function. This expects three arguments called a, b, and c, which correspond to the A, B, and C values defined in the high-level R1CS equation we talked about above. Each one of them is of type LinearCombination<F>, which is nothing more than a Vec<(F, Variable)> (variable being either a constant, public/private input or another linear combination). This is just a way of encoding a sum of the form: $$ \sum a_k x_k $$ The $a_k$s are of type F, the $x_k$s are variables. Going back to our example, we defined our constraint by passing a, b, and c as: use ark_std::One; a = lc!()
b = lc!()
c = lc!() + (ark_ed_on_bls12_381::Fq::one(), a) - (ark_ed_on_bls12_381::Fq::one(), b) The macro lc!() is provided by Arkworks and just generates an empty linear combination, i.e., zero. For our c, we are substracting from variable (ark_ed_on_bls12_381::Fq::one(), a) the variable (ark_ed_on_bls12_381::Fq::one(), b) which is just a complicated way of saying a - b inside our finite field. Putting it all together, our constraint is $$ 0 + 0 = a - b $$ a.k.a. $$ a = b $$ Note that this is not the only way of writing this constraint, in our case we could have also defined a = (ark_ed_on_bls12_381::Fq::one(), a) - (ark_ed_on_bls12_381::Fq::one(), b)
b = (ark_ed_on_bls12_381::Fq::one(), 1)
c = lc!() encoding the equation $$ (a - b) * 1 = 0 $$ As is clear from this example, it is much easier to work with gadgets if you can, as they abstract a lot of details from the programmer.

